import React from "react";
import SliderCarousel from "./SliderCarousel";

// style component
import "./style/reviews.css";

function reviews() {
  return (
    <>
        <SliderCarousel />
      <div className="customerReviews">
      </div>
    </>
  );
}

export default reviews;
